import Layout from '../components/Layout';

const Index = ({posts}) => {
   console.log(posts);
    return (
    <Layout>
        Hello world. home page
        <div>
            {posts.map(item => (
                <h1>item</h1>
               ) )}
        </div>
    </Layout>
    )
}

Index.getInitialProps = async (context) => {
    return {
        posts: ['John', 'Jim', 'Jerry', 'Joseph', 'Jimmy']
    }
}

export default Index;
